s($,"aPb","dw",()=>{var q="https://evagamayun.com/product/black-hole-in-the-milky-way-print/?attribute_pa_edition=signed-print&attribute_pa_size=l-19x19",p="https://evagamayun.com/shop/",o="A world of swirling clouds and vibrant storms, hiding secrets of the cosmos beneath magnificent rings.",n="https://evagamayun.com/shop"
return A.b([A.bg("https://evagamayun.com/product/allure-print/","The aesthetic experience stimulates the mind and evokes feelings of transcendence, awe, and a sense of connection to something greater than oneself.","assets/images/cards/allure.jpg","Allure","Uplifting power of beauty."),A.bg("https://evagamayun.com/product/anima-print/?attribute_pa_edition=signed-print&attribute_pa_size=m-12x23","Evolving from the chaos into a refined force, the anima unlocks new dimensions in a psyche. It is a bridge between the ego and the unconscious.","assets/images/cards/anima.jpg","Anima","Source of creative energy."),A.bg("https://evagamayun.com/product/bittersweet-print/?attribute_pa_edition=signed-print&attribute_pa_size=l-19x19","The awareness of inevitable mortality can be a catalyst for a personal growth, a greater sense of authenticity, and mindfulness. It leads to clarity and courage, a deeper appreciation of life, and wisdom in making life choices.","assets/images/cards/bitter.jpg","Bittersweet","Memento Mori."),A.bg(q,"A moment inside me is slowing down and lasts for eternity. Life is not a mystery to solve, but a reality to experience.","assets/images/cards/blackhole.jpg","Black Hole in the Milky Way","Taste the Universe."),A.bg("https://evagamayun.com/product/blue-valentine-print/?attribute_pa_edition=signed-print&attribute_size=12x16%22","The witch dissolves into her own misty dilemmas, as her form morphs like a mirage. She is not just a witch, but a being of magic and mystery, a force of nature that cannot be contained or controlled.","assets/images/cards/blueval.jpg","Blue valentine","A limitless potential."),A.bg("https://www.inprnt.com/gallery/evagamayun/a-case-of-identity/","The self is a continuous formation through choice of action. Every choice you make makes you.","assets/images/cards/caseofid.jpg","Case of Identity","Decision, action, change."),A.bg("https://evagamayun.com/product/cat-cloud-print/","How came I can fly now? Maybe I always could. They would never find me here. I think I might catch this bird.. and maybe even the Sun, if I hurry up!","assets/images/cards/catcloud.jpg","Cat Cloud","Another level. Flying high."),A.bg(q,"Irrelevant information is constantly being filtered out from our perception, leaving the effect of complete immersion in the beautifully rendered dream.","assets/images/cards/chroma.jpg","Chroma Key","Observe your surroundings."),A.bg("https://evagamayun.com/product/code-persephone-print/","A software designed to control the cycle of existence. It stimulates the emergence of life, making the human experience more valuable, concentrated, and effective for the entire system","assets/images/cards/codepers.jpg","Code Persephone","Balance and renewal."),A.bg(p,"To journey beyond the shimmering digital currents, ready your digital coins for the ferryman's fare. He shall guide the bytes of your soul into the luminous eternity of the virtual realm.","assets/images/cards/crypto.jpg","Crypto Styx","Preparing for the voyage."),A.bg("https://evagamayun.com/product/demeowurge-print/",o,"assets/images/cards/demeow.jpg","Demeowurge","The flighty Grand Design."),A.bg(p,o,"assets/images/cards/dizzy.jpg","Dizzy Dream","Stormy tranquility."),A.bg("https://evagamayun.com/product/double-print/","Admit your shadow-self, discipline and integrate with it. Together you will discover sources of energy and creativity you wouldn't otherwise have.","assets/images/cards/double.jpg","Double","Colaboration with Self."),A.bg(p,"Sometimes I believe in as many as six impossible things before breakfast.","assets/images/cards/dragonfox.jpg","Dragon Fox","Games of imagination."),A.bg("https://www.inprnt.com/gallery/evagamayun/ethereal-echoes/","Do you feel this subtle cosmic connection? It\u2019s much like a phantom memory of a life in another version of reality. Or an echo of the multiverse.","assets/images/cards/echoes.jpg","Ethereal Echoes","Answer from alternate world."),A.bg(p,"Consequences and data are minor. The experiment will go on, ever in pursuit of harmony and wholeness.","assets/images/cards/equi.jpg","Equilibrium","State of balance between opposing forces."),A.bg("https://www.inprnt.com/gallery/evagamayun/felinoid-fall/","The blue moon, a symbol of the unknown, the forces that are beyond our control. Yet, the alien cat's ability to navigate this unfamiliar terrain suggests that even in the face of uncertainty, we can find the right path.","assets/images/cards/felinoid.jpg","Felinoid Fall","That is the way."),A.bg("https://evagamayun.com/product/fluid-print/","Shamans flow freely through a spectrum of identities, between the rational and the irrational, the material and the transcendent, overcoming the norms and catalyzing change.","assets/images/cards/fluid.jpg","Fluid","Shift of the paradigms."),A.bg("https://evagamayun.com/product/froggies-print/?attribute_pa_edition=fine-art&attribute_pa_size=m-16x24","Some questions or problems may not have a simple or final answer, and the pursuit of knowledge or understanding may be an endless journey.","assets/images/cards/frogs.jpg","Frogs All The Way Down","The cosmic truth is not what it seems."),A.bg("https://www.inprnt.com/gallery/evagamayun/genesis/","Made in Cosmos. Ingredients: 99% stardust, 1% insecurities, and a bit of drama. Treat with love and care. Expiration date is unknown.","assets/images/cards/genesis.jpg","Genesis","Appreciation and carring."),A.bg("https://evagamayun.com/product/gravity-trance-print/","Spacetime tells matter how to move; matter tells spacetime how to curve. The interconnection is fundamental.","assets/images/cards/gavity.jpg","Gravity Trance","Mutual influence. Connection."),A.bg("https://evagamayun.com/product/inner-fish-print/","The fish doesn\u2019t think, the fish knows everything. Humans are the result of an evolutionary journey that life has undertaken throughout time. Unconsciously, we are the keepers of a hidden pervasive knowledge.","assets/images/cards/innerfish.jpg","Inner Fish","Natural wisdom."),A.bg("https://www.inprnt.com/gallery/evagamayun/its-jellyfishing-outside-tonight/","In the darkened sky, the glowing jellyfish floated serenely, drifting through the empty snowy streets as the dog's confused barking echoed around them.","assets/images/cards/jelly.jpg","It's Jellyfishing Outside Tonight","Unexpected phenomenon."),A.bg("https://evagamayun.com/product/kintsugi-print/","In this ancient art, shattered pottery finds rebirth in the gentle embrace of precious lacquer. As the golden threads weave through the cracks, they whisper tales of inner strength, turning scars into symbols of endurance.","assets/images/cards/kints.jpg","Kintsugi","Healing and resilience."),A.bg("https://evagamayun.com/product/lava-lamp-print/","The only way to immortality for a drop of wax is to cease thinking of itself as a drop and to recognize that it is wax. However, realizing one's true nature is nearly impossible, and the only aspect the wax perceives is its fleeting form.","assets/images/cards/lava.jpg","Lava Lamp","Mind expansion. Freedom."),A.bg("https://www.inprnt.com/gallery/evagamayun/lunacy/","The giant pink Moon seemed to pulsate with a life of its own. She experienced a full mind's eclipse at the very first bite. It was a love that transcended time and space, a love that was as eternal as the vast Cosmos itself.","assets/images/cards/lunacy.jpg","Lunacy","Insanity and affection."),A.bg("https://evagamayun.com/product/lunar-pollen-print/","You are surrounded by spirits of transformation spreading their pollen in the air.","assets/images/cards/lunpoll.jpg","Lunar Pollen","Rustle of changes."),A.bg("https://evagamayun.com/product/mindmelter-print/","My consciousness has melted into a furious stream. I felt a sense of wonder at the sheer impossibility of it all. Some things in life are simply beyond explanation.","assets/images/cards/mindmelt.jpg","Mind Melter","Strong impression."),A.bg("https://www.inprnt.com/gallery/evagamayun/mistress-of-the-dark-algorithm/","The Architecture, a simulation itself, she isn\u2019t perfect. As the Universe tries to understand its own self, any glitches or bugs in reality are constantly being fixed.","assets/images/cards/mistress.jpg","Mistress of The Dark Algorithm","Magic or sufficiently advanced technology."),A.bg("https://www.inprnt.com/gallery/evagamayun/moira/","We are exactly what we pretend to be, so we must be careful about what we pretend to be.","assets/images/cards/moira.jpg","Moira","Revel in a role."),A.bg("https://www.inprnt.com/gallery/evagamayun/neodragon/","The dragon cannot be tamed, it can only be understood. In the luminous realm, she met the legendary guardian. It was the tenth dragon, the keeper of the virtual reality, technology, and information.","assets/images/cards/neodragon.jpg","Neodragon","A friendship with a marvelous beast."),A.bg("https://evagamayun.com/product/neon-midas-print/","..and the people bowed and prayed to the neon God they made.","assets/images/cards/midas.jpg","Neon Midas","Beware of what you pursue."),A.bg(n,"The energy of the expanding shock wave, caused by a Star's collapse, is sufficient to disrupt the stellar material, forming a supernova. Its sacrifice contributes to the chemical evolution of the Universe.","assets/images/cards/sepukku.jpg","Neutron Seppuku","Gratitude to the stars."),A.bg("https://evagamayun.com/product/ontology-of-touch-print/","The reef holds the mystery of the deep ocean, a surreal world hidden beyond our own.","assets/images/cards/onttouch.jpg","Ontology of Touch","Touching the unknown."),A.bg("https://www.inprnt.com/gallery/evagamayun/perception/","Imagine a kaleidoscope of alternate personalities in the Multiverse. There's a universe where you made every possible choice.. every but one.","assets/images/cards/perc.jpg","Perception","Infinite possibilities."),A.bg("https://www.inprnt.com/gallery/evagamayun/phantom-rain/","Emotions can feel overwhelming and appear to be an accurate representation of reality. However, in fact, they are illusory, transient, and may distort one\u2019s perception.","assets/images/cards/phrain.jpg","Phantom Rain","It\u2019s raining in your head."),A.bg("https://evagamayun.com/product/psyche-fusion-print/","A realm, where sentient alien fungi merge with humans in a harmonious fusion, bestowing additional powers and abilities upon them. This synthesis ignites a beautiful transformative journey within.","assets/images/cards/psyche.jpg","Psyche Fusion","Unlocking hidden potential."),A.bg("https://evagamayun.com/product/recovery/","She finds a source of energy deep within the virtual realm. Here the omnipresent network represents reality as the general consensus of all perceptions, memories, and knowledge.","assets/images/cards/recov.jpg","Recovery","Recharge to gain strength."),A.bg("https://evagamayun.com/product/refraction-of-the-spotless-mind-print/","A psyche, like a prism, refracts the light of awareness into myriad colors, each representing a dimension of our being.","assets/images/cards/refraction.jpg","Refraction of the Spotless Mind","Facets of subconscious."),A.bg("https://www.inprnt.com/gallery/evagamayun/reflexion/","On a Summer Solstice night, she meets the Other, allowing her inner subjectivity to dissolve in a dazzling shine of their mutual reflection.","assets/images/cards/reflex.jpg","Reflexion","Dissolve to become whole."),A.bg("https://www.inprnt.com/gallery/evagamayun/scream-of-a-great-bat/","Once, the stars in the sky seemed other worlds to me. Now, I know these sharp points are the holes in the armor protecting us from the ocean of ruthless light.","assets/images/cards/greatbat.jpg","Scream of a Great Bat","Sudden profound insight."),A.bg("https://www.inprnt.com/gallery/evagamayun/sleeping-sands/","A metaphysical desert of alien pink sands, akin to a Limbo, where one's mind wanders during sleep. There, consciousness drifts through vast dunes, untethered from the constraints of logic.","assets/images/cards/ssands.jpg","Sleeping Sands","If you want to wake up, you need to fall asleep."),A.bg("https://evagamayun.com/product/solar-pollen-print/","Amaterasu caught a faint glimpse of her reflection in the mirror. As she emerged of her hiding place to see more of her own beauty, the world has become illuminated by the Sun again.","assets/images/cards/pollen.jpg","Solar Pollen","The light goes up."),A.bg("https://www.inprnt.com/gallery/evagamayun/spherical-love-in-the-void/","An exact formula of the most ideal, eternal, and pure love \u2014 love that is devoid of the complexities and challenges that real relationships inevitably entail.","assets/images/cards/lovevoid.jpg","Spherical Love in the Void","Impossible desires."),A.bg("https://evagamayun.com/product/sunbeam-print/","What am I? The Universe, expressing itself as a human for a little while. I won\u2019t let it down. The Universe would remember this party forever.","assets/images/cards/sunbeam.jpg","Sunbeam","Joy of experiencing life."),A.bg("https://evagamayun.com/product/swirling-sensation-print/","Jupiter's violent nature has a strong tendency to melt and vaporize anything, while its magnetic field causes some of the solar system's most spectacular aurorae.","assets/images/cards/sensation.jpg","Swirling Sensation","Embrace your powers."),A.bg(n,"As the sky brightened with the approaching dawn, the birds' voices rose in a symphony of anticipation, hinting at hidden knowledge. Every chirp, whistle, and squawk seemed to carry an undercurrent of excitement.","assets/images/cards/symph.jpg","Symphony #4 AM","Melody of chaos."),A.bg("https://evagamayun.com/product/the-serpent-golden-foil/","A wise spirit of the Eden, representing the ability to shed old ways of thinking and to embrace the new ones.","assets/images/cards/serpent.jpg","The Serpent","Learning is a treasure."),A.bg("https://evagamayun.com/product/traum-print/","All her dreams came true and that made her sad, longing for the experiences and growth that occurred along the way.","assets/images/cards/traum.jpg","Traum","It's not about the destination, it's about the journey"),A.bg("https://evagamayun.com/product/ultra-vision-print/","What is perceived by the senses may not reflect the ultimate truth. An insight, understanding, or a different perspective can be gained through introspection or meditation. Delve into the serenity within. There you will hear the melody that echoed far beyond the superficial chaos of the outside world.","assets/images/cards/vision.jpg","Ultra Vision","Close your eyes and you will see.")],A.aD("B<rt>"))})
